        #region 采用 Xamarin.Essential 的方法进行分享

        private void Button_Essential_ShareText(object sender, EventArgs e)
        {
            try
            {
                //// 无法在 Wechat / QQ 中分享
                //Xamarin.Essentials.Share.RequestAsync(new Xamarin.Essentials.ShareTextRequest()
                //{ 
                //    Title = "分享信息",
                //    Subject = "标题"
                //});

                // 可以在 Wechat / QQ 中分享
                Xamarin.Essentials.Share.RequestAsync(txtShareMsg.Text);
            }
            catch (Exception ex)
            {
                Acr.UserDialogs.UserDialogs.Instance.Alert(new Acr.UserDialogs.AlertConfig()
                {
                    Title = "捕获异常",
                    Message = ex.GetInfo(),
                    OkText = "确认"
                });
            }
        }

        async void Button_Essential_ShareImage(object sender, EventArgs e)
        {
            try
            {
                string base64Str = "";
                string filePath = System.IO.Path.Combine(Common.StaticInfo.AndroidExternalFilesPath, "testShare.png");
                System.IO.File.WriteAllBytes(filePath, Convert.FromBase64String(base64Str));

                await Xamarin.Essentials.Share.RequestAsync(new Xamarin.Essentials.ShareFileRequest
                {
                    Title = Title,
                    File = new Xamarin.Essentials.ShareFile(filePath)
                });
            }
            catch (Exception ex)
            {
                Acr.UserDialogs.UserDialogs.Instance.Alert(new Acr.UserDialogs.AlertConfig()
                {
                    Title = "捕获异常",
                    Message = ex.GetInfo(),
                    OkText = "确认"
                });
            }
        }

        async void Button_Essential_ShareFile(object sender, EventArgs e)
        {
            try
            {
                // 无任何 app 支持
                // var file = System.IO.Path.Combine(Common.StaticInfo.AndroidExternalFilesPath, "NativeSettings.config");

                var fn = "Attachment.txt";
                var file = System.IO.Path.Combine(Common.StaticInfo.AndroidExternalFilesPath, fn);
                System.IO.File.WriteAllText(file, "Hello World");

                await Xamarin.Essentials.Share.RequestAsync(new Xamarin.Essentials.ShareFileRequest
                {
                    Title = Title,
                    File = new Xamarin.Essentials.ShareFile(file)
                });
            }
            catch (Exception ex)
