        #region 分享内存的图片数据到

        private void Button_ShareImage_ByteArr(object sender, EventArgs e)
        {
            try
            {
                byte[] data = null;
                string filePath = System.IO.Path.Combine(Common.StaticInfo.AndroidExternalFilesPath, "testShare.png");
                using (var fs = new System.IO.FileStream(path: filePath, mode: System.IO.FileMode.Open))
                {
                    data = new byte[fs.Length];
                    fs.Read(data, 0, data.Length);
                }

                App.MyShareUtils.ShareImage(data);
            }
            catch (Exception ex)
            {
                Acr.UserDialogs.UserDialogs.Instance.Alert(new Acr.UserDialogs.AlertConfig()
                {
                    Title = "捕获异常",
                    Message = ex.GetInfo(),
                    OkText = "确认"
                });
            }
        }

